import styles from './Search.module.scss'
import Proper from '../../Proper';

function SearchRender({list, searchValue}) {

  const listResultRender = (list, value) => {
    if (list.length > 0 && value) {
      return (
        <>
          {list.map((result, index) => {
            return (
              // <div className={styles['wrapper-proper']}>
                <Proper key={index} data={result}  searchValue={result.name} avatar={result.avatar} />
              // </div>
            );
          })}
          <p className={styles['show-result']}>View all results for "{value}"</p>
        </>
      );
    } else if(value) {
      return <p className={styles['show-result']}>View all results for "{value}"</p>
    }
  }

  return (
    <div className={styles['search-list']}>
      {listResultRender(list, searchValue)}
    </div>
  );
}

export default SearchRender;
